        "description": "# Мобильный кондей\n#* + Можно быстро купить и подключить\n#* + Дешево\n#* - Не эстетично\n#* - Занимает место на полу\n#* - Нужно высовывать шланг в окно\n#* - На каждую комнату нужен свой, либо таскать туда-сюда\n# Мобильный кондей без шланга\n#* + Можно быстро купить и подключить\n#* - Занимает место на полу\n#* - Работает несколько часов, после чего должен остыть\n#* - На каждую комнату нужен свой, либо таскать туда-сюда\n# Моноблок\n#* - Нужно делать дыру в стене или окне.\n#* - На дыру в стене все равно нужно разрешение\n#* - Занимает место\n#* - На каждую комнату нужен свой\n#  Стационарная сплит система\n#* + Одно решение на все комнаты\n#* + Аккуратно\n#* - Нужно разрешение на установку\n#* - Дорого\n# Сплит система с подключением к воде\n## + Аккуратно\n## + Не нужно разрешение\n## - Очень дорого\n## - Тратит воду",
